import React from 'react';
import './App.css';
import Navigation from './Component/Navigation/Navigation';
import Logo from './Component/Logo/Logo';
import ImageLinkFrom from './Component/ImageLinkFrom/ImageLinkFrom';
import Rank from './Component/Rank/Rank';
import clarifai from 'clarifai';

const app=new clarifai.App({apiKey:'72774027cc6841429db15567c0e547f4'});



class App extends React.Component{
  constructor(){
    super();
    this.state={
      input:'',
    }
  }

  oninputchange=(event)=>{
    console.log(event.target.value);
  }

  onbuttonsubmit=()=>{
    console.log("click");
    app.model.predict("72774027cc6841429db15567c0e547f4","https://images.unsplash.com/photo-1507003211169-0a1dd7228f2d?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8Mnx8ZmFjZXN8ZW58MHx8MHx8&w=1000&q=80")
    .then(
      function(response){
        console.log(response);
      }
    )
  }

  render() {
  return (
    <div className="App">

      <Navigation />
      <Logo />
      <Rank />
      <ImageLinkFrom  oninputchange={this.oninputchange} onbuttonsubmit={this.onbuttonsubmit} />
    </div>
  );
}
}

export default App;
